import React from "react";
function insert()
{
    return(
        <h1>INSERT</h1>
    )
}
function BST()
{
    return(
        <>
        <h1>BST TREE</h1>
        <button>INSERT</button>
        <button>DELETE</button>
        <button>INORDER</button>
        <button>PREORDER</button>
        <button>POSTORDER</button>
        </>
    )
}
export default BST;
